<h5>If your search is not showing desired output then make sure that you wrote the input correctly.</h5>
<div>
    <input type="text" id="searchTerm" placeholder="Search the History..." style="width:502px; height:50px;">
    <button class="Button" onclick="search()">Go!</button>
</div>
<div id="article"></div>

<script>
    const articleContainer = document.getElementById('article');

    function search() {
        const searchTerm = document.getElementById('searchTerm').value.trim();
        if (searchTerm === '') {
            alert('Please enter a something.');
            return;
        }
        
        fetchData(searchTerm);
    }

    // Function to fetch Wikipedia data using axios
    const fetchData = async (searchTerm) => {
        try {
            const response = await axios.get(`https://en.wikipedia.org/w/api.php?action=query&format=json&prop=extracts|pageimages&exintro=true&titles=${searchTerm}&formatversion=2&origin=*`);
            const page = response.data.query.pages[0];
            const articleTitle = page.title;
            const articleContent = page.extract;
            const articleImage = page.pageimage;

            const articleHTML = `
                <h1>${articleTitle}</h1>
                <p>${articleContent}</p>
                <img src="https://en.wikipedia.org/wiki/Special:FilePath/${articleImage}" alt="${articleTitle} Image">
            `;

            articleContainer.innerHTML = articleHTML;
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };
</script>
</body>
